import React, { useState } from "react";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import SignUp from "./SignUp"
import SignIn from "./SignIn"
import { Typography } from "@mui/material";

export default function DialogWrapper(props) {
  const { dialogOpen, handleDialogClose } = props;
  const [toggleSignUp, setToggleSignUp] = useState(true)

  const handleSignUpToggle = () => {
    setToggleSignUp(!toggleSignUp)
  }

  return (
    <div>
      <Dialog style={{ padding: "1rem" }} open={dialogOpen} onClose={handleDialogClose}>
        {toggleSignUp ? <SignUp /> : <SignIn />}
        {/* <DialogActions>
          <Button onClick={handleDialogClose}>Cancel</Button>
          <Button onClick={handleSignUpToggle}>{toggleSignUp ? "Sign In" : "Sign Up"}</Button>
        </DialogActions> */}
        <div>
          <Typography variant="body2">Don't have an account yet? Sign Up</Typography>
        </div>
      </Dialog>
    </div>
  );
}
